import React from "react"
import GithubContact from "./GithubContact"
import LinkedinContact from "./LinkedinContact"

class Social extends React.Component {
    render() {

        return (
            <div>
            	<ul class="social-icons">
            		<li>
            			<GithubContact />
            		</li>
            		<li>
            			<LinkedinContact />
            		</li>
            	</ul>
            	
            </div>
        )
    }
}

export default Social
